    StaffComponent.prototype.enrollCustomerDetails = function () {
        var _this = this;
        var missingCount = this.rightMissing.length + this.leftMissing.length + this.thumbsMissing.length;
        this.customer = this.form.value;
        this.customer.fingerPrints = this.enrolledFPrints;
        console.log('length', this.enrolledFPrints.length);
        if (this.enrolledFPrints.length > 10) {
            return this.toastr.warning('It appears you have captured more than the required 10 finger prints, '
                + ' kindly reset device to continue!', 'Warning', { timeOut: 4000 });
        }
        //Capture Atleast one finger print
        if (this.enrolledFPrints.length < 1) {
            this.log(this.rightId, 'Trying to enroll less than one fingerprint for CIF ' + this.customer.customerId);
            return this.toastr.error('Kindly ensure you have captured atleast one fingerprint to continue.', 'Error!', { timeOut: 4000 });
        }
        //No missing fingers
        if (missingCount === 0 && this.enrolledFPrints.length < 10) {
            this.log(this.rightId, 'Enrolled less than 10 FP for CIF ' + this.customer.customerId +
                ' missing FPs: ' + missingCount + '. Enrolled FP(s): ' + this.enrolledFPrints.length);
            return this.toastr.error('Kindly ensure you have captured all the fingerprints to continue .', 'Error!', { timeOut: 4000 });
        }
        this.apiService.afisEnroll(this.customer).subscribe(function (response) {
            _this.response = JSON.parse(response);
            if (_this.response.status === true) {
                _this.log(_this.rightId, 'Enrolled: ' + _this.customer.customerName + ' CIF: ' + _this.customer.customerId +
                    ' missing FPs: ' + missingCount + '. Enrolled FP(s): ' + _this.enrolledFPrints.length);
                _this.storeCustomer();
            }
            else {
                _this.log(_this.rightId, 'Failed to enroll: ' + _this.customer.customerName + ' CIF: ' + _this.customer.customerId +
                    ' missing FPs: ' + missingCount + ' Failed FP(s): ' + _this.enrolledFPrints.length);
                _this.toastr.warning(_this.response.message + ' customer id ' + _this.response.customerId + '', 'Warning!', { timeOut: 4000 });
            }
        }, function (error) {
            _this.log(_this.rightId, 'Failed to enroll ' + _this.customer.customerName + ' CIF: ' + _this.customer.customerId +
                ' missing FPs: ' + missingCount + ' Failed FP(s) ' + _this.enrolledFPrints.length);
            return _this.toastr.error('Error updating data.', 'Error!', { timeOut: 4000 });
        });
        // }
    };
