    StaffComponent.prototype.getCustomer = function (cust) {
        if (cust === '') {
            return this.toastr.warning('Kindly provide valid customer/staff id to continue', ' Warning!', { timeOut: 4000 });
        }
        if (this.profType === '2') {
            // this is a teller: must start with KE.
            if (!cust.startsWith('KE')) {
                return this.toastr.warning('Staff id must start with KE', ' Warning!', { timeOut: 4000 });
            }
            else if (cust.length <= 2) {
                return this.toastr.warning('Enter a valid staff ID', ' Warning!', { timeOut: 4000 });
            }
            else {
                this.tellerInquiry(cust);
            }
        }
        else {
            // this is a customer
            this.customerInfInquiry(cust);
        }
    };
    StaffComponent.prototype.tellerCoBankingInq = function (teller) {
        var _this = this;
        // this.tellerSvc.getTllrDetails().subscribe (data => {
        this.blockUI.start('Searching for Staff...');
        this.tellerSvc.getTellerDetails(teller).subscribe(function (res) {
            _this.blockUI.stop();
            console.log("teller data", res);
            var data = JSON.parse(res);
            if (data.payload) {
                if (data.payload.cif !== null) {
                    _this.tellerInq = data;
                    if (_this.tellerInq.payload.cif !== null && _this.tellerInq.payload.cif !== '') {
                        _this.account_number = ' ';
                        _this.initTellerProfile();
                        return _this.toastr.success('Staff id is valid, can proceed to enroll', ' Success!');
                    }
                    else if (_this.tellerInq.payload.cif === '') {
                        // valid customer returned but they do not have a cif number attached
                        return _this.toastr.warning('CIF number is invalid', ' Warning!');
                    }
                    else {
                        return _this.toastr.warning('Specified staff id was not found or invalid , kindly verify to proceed .', 'Warning!');
                    }
                }
                else {
                    return _this.toastr.error('CIF Number is Null', 'Error!', { timeOut: 4000 });
                }
            }
            else {
                return _this.toastr.warning(data.respMessage || 'Error getting staff with specified ID', 'Warning!');
            }
        }, function (error) {
            console.log(error);
            _this.blockUI.stop();
            return _this.toastr.error("Error: " + error.respMessage, 'Error!', { timeOut: 4000 });
        });
    };
